                        {
                            "HeroBannerRichText": {
                                "content": "The Quantitative Factor Model (Q-ModelÂ®) systematically creates a portfolio of inexpensive stocks and waits for the market to recognize their value. Briefly, the model screens stocks based on six pre-specified equity characteristics (factors), and selects stocks that contain more of these factors. The chosen factors are high yield, low P/E ratio, low P/BV ratio, high ROE, and high price and earnings momentum. The Q-Model rigorously adheres to selecting stocks based on their relative factor rankings, removing the emotional element of investing. There have been no changes to the model since its inception. The model is designed for large cap stocks, and currently uses the S&P/TSX 60 and the next largest 60 companies for the Canadian universe. It remains 100% invested in equities at all times and has produced winning results over a long period without relying on market timing."
                            }
                        }
